import React from 'react'
import styled from 'styled-components'
import Startinvesting from './Startinvesting'

import {Link}from "react-router-dom";

function Home() {
    return (
        <div>

        <Startinvesting/>
            <Head>
                <Card>
                    <h1>Future Is Here !! </h1>
                    <p>Millions Of People are trusting us to invest in thosands of crytpo currency</p>
                </Card>

                <Card>
                    <h1> Fear Of Loss !! </h1>
                    <p>You Can Just loss the capital you have ! but you can earn millions that you never thought oF</p>
                </Card>

                <Card>
                    <h1>No Money In Hands !! </h1>
                    <p>We are also providing loans to the people who don't have enough money to TRADE </p>
                </Card>
            </Head>
        </div>
    )
}

export default Home


const Head = styled.div`
margin:2rem;
display: flex;
flex-wrap:wrap;
justify-content: space-between;
margin-inline: 10rem;
`
const Card = styled.div`
font-family: 'Baloo Bhaina 2', cursive;
width: 17rem;
padding:2rem;
border-radius: 1rem;
background-color: rgb(229, 119, 119);
text-align:center;
cursor: pointer;
transition: 0.17s all ease;
h1{
    color: black;
}
box-shadow: 1px 10px 25px black;
&:hover{
    transform: scale(1.05);
    box-shadow: 5px 1px 25px black;
}
`
